import Gallerycard from './components/gallery';
import './App.css';
import one from './components/assets/images/1.jpg';
import two from './components/assets/images/attackontitan.jpg';
import './index.css'

const GalleryData = [
  {
    image: one,
    title: "Black cover",
  }
  ,
  {
    image: two,
    title: "Attack on Titan",
  }
];
function App() {
  return (
    <>
     <h1 style={{margin:"0px", padding:"0px"}}>Anime Gallery</h1>
    <div className='gallery'>
      {
        GalleryData.map((gallery)=>{
          const {image, title} = gallery;
          return (
            <Gallerycard image={image} title={title} />
          )
        })
      }
    </div>
    </>
  );
}

export default App;
